import React from "react";
import './App.css';
import Login from "./components/login";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {

  return (
    <Router>
      <div className = "App App-header">
        <Switch>
          <Route path="/registro">
            <Registro/>
          </Route>
        </Switch>
        <Switch>
          <Route path="/login">
          <Login/>
          </Route>
        </Switch>
    </div>
    </Router>
  );
}

export default App;
